		public class Solution
		{
			public int LengthOfLongestSubstring(string s)
			{
				char[] arr = s.ToCharArray();
				int maxLength = 0;

				StringBuilder sbuf = new StringBuilder();
				HashSet<char> founds = new HashSet<char>();

				for (int i = 0; i < arr.Length; i++)
				{
					if (maxLength >= (arr.Length - i))
						return maxLength;

					for (int j = i; j < arr.Length; j++)
					{
						char c = arr[j];
						if (!founds.Contains(c))
						{
							founds.Add(c);
							sbuf.Append(c);
							maxLength = Math.Max(maxLength, sbuf.Length);
						}
						else
							break;
					}
					sbuf.Clear();
					founds.Clear();
				}
				return maxLength;
			}

			public int LengthOfLongestSubstringWithRepeatedChars(string s)
			{
				char[] arr = s.ToCharArray();
				int maxLength = 0;

				StringBuilder sbuf = new StringBuilder();
				HashSet<char> foundChars = new HashSet<char>();

				string maxString = string.Empty;

				for (int i = 0; i < arr.Length; i++)
				{
					if (maxLength >= (arr.Length - i))
						return maxLength;

					for (int j = i; j < arr.Length; j++)
					{
						string currentString = s.Substring(i, j - i + 1);

						char c = arr[j];

						if (maxString.Contains(c))
							break;

						maxLength = Math.Max(currentString.Length, maxLength);
					}

				}

				return maxLength;
			}


